import React, { Component } from 'react';
import API from '../utils/api';

class News extends Component {
  state = {
    articles: [],
  }

  api = new API();

  componentDidMount = () => {
    this.api.getNews() 
    .then(res => res.json())
    .then(el => this.setState({ articles: el.articles }));
  }

  render() {
    return (
      <div className="main-container">
        NEWS
      </div>
    )
  }
}

export default News;
